            {
                Login = login,
                PassCrypt = pass,
                NickName = nick,
                DateRegistration = DateTime.UtcNow,
                PathAvatar = "default-avatar.png",
                Role = UserRole.User

            };
            user.CreateUser(newUser);
            Navigation.NavigateTo("/login", true);
        }
